            <div  className='para'>                    
                    <p>We believe that loving your pet and loving the planet is something that can be done together - which is why weve created our very own sustainable pet food brand here at Conscious Creatures.</p>
                    <p> Conventional pet food has plenty of nutrients for your animal but it also is made from sources of animal protein that cause harm to our planet. Our insect-based dog treats have all of the amazing nutrition you would expect from top-quality air-dried brands and actually helps the planet. Instead of using industrial livestock to get our protein, we use an amazing little bug called the Black Soldier Fly Larvae.</p>
                    
                    <p>Black Soldier Fly Larvae actually eat agricultural waste, which would have turned into methane, a greenhouse gas that heats up our planet, so it's not just cutting out waste that is making a positive impact.</p>
                    <p>We ask you to join us in our mission to make the best pet food on the planet, while keeping mother earth happy as well - lets all be Conscious Creatures!</p>
                
                    <div className='learnmore-div'>
                        <button className="learn-btn">I WANT TO KNOW MORE</button>
                    </div>
            </div>

